import React from 'react'
import styled from 'styled-components'
import {Link} from 'react-router-dom'

function HomeBtn() {
    const HomeBtnBlock =styled.div`
        width:200px;
        height:200px;
        background:#eee;
        border:none;
        &:hover {
            background:#333;
        }
        font-size:24px;
        font-weight:bold;

    
    
    `
    return (
        <HomeBtnBlock>
            <Link to ="/">
                Home
            </Link>
        </HomeBtnBlock>
    )
}
export default Homebtn
